/* harmony default export */ __webpack_exports__["default"] = ("<section class=\"section-study-culture\">\n    <div class=\"breadcum\">\n        <a>\n            <i class=\"icon icon-ex-small\">\n                <svg focusable=\"false\">\n                    <use xlink:href=\"#icon_home\"></use>\n                </svg>\n            </i>\n        </a>\n        <span> |</span>\n        <a>\n            The\n            Premian Story\n        </a>\n    </div>\n    <div class=\"row-f\">\n\n        <div class=\"col-lg-8 col-md-8 col-sm-12\">\n            <h1>\n                The<br>\n                Premian Story\n            </h1>\n\n\n            <div class=\"panel\">\n                <h2>\n                    Who we are\n                </h2>\n                <div class=\"panel-body\">\n                <p>We are a group of committed individuals who believe that “What sculpture is to a block of marble, education is to the human soul.” Joseph Addison.\n                    <br><br>\n                    Our advisory board comprises of diverse academicians who have a keen interest in providing a unique perspective to our collective vision. Individually they have contributed tremendously to the field of education, together they bring their unique capacities to our advisory board supporting continual improvement and sustainability.\n                    <br><br>\n                    We want to nurture a confident, compassionate student body that is ready to make a positive difference to the World. We affirm that every child deserves a childhood filled with love and positivism. That is the core belief, with which we will take care of each child, as this will contribute to making exemplary individuals.\n                    </p>\n                </div>\n            </div>\n        </div>\n        <div class=\"img-flag\">\n            <img src=\"assets/images/5.jpg\">\n        </div>\n\n    </div>\n    <div class=\"clearfix\"></div>\n\n    <div class=\"row\">\n        <div class=\"col-lg-1 col-md-1 col-sm-12\"></div>\n        <div class=\"col-lg-11 col-md-11 col-sm-12\">\n        <div class=\"panel\">\n                <p>Just like any involved parent, our Director, Sinduri Reddy, began a quest to find a school that would nurture her growing preschoolers in the best way possible.\n                    <br><br>\n                    After putting together the best of schools and undergoing immense research, there were still certain factors like cleanliness, Ethos, Curriculum Focus, distance, etc. that made it impossible for her to choose. \n                    So, like a popular thought,” when you can’t find someone to do exactly what you, get up and do it yourself!” That’s exactly what she did! \n                    <br><br>\n                    Her endeavours have snowballed into the Premia Academy.\n                </p>\n               \n            </div>\n        </div>\n\n    </div>\n\n\n\n\n</section>");

